-- -----------------------------------------------------
-- Schema scage
-- -----------------------------------------------------
CREATE SCHEMA IF NOT EXISTS scage DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci ;
USE scage ;


CREATE TABLE users (
  id BINARY(36) NOT NULL,
  name VARCHAR(150) NOT NULL,
  email VARCHAR(150) NOT NULL,
  sex ENUM('Masculino', 'Feminino') NOT NULL,
  isEnable TINYINT(1) NULL DEFAULT 1,
  modifiedOn DATETIME NULL DEFAULT NULL,
  createdOn DATETIME NULL DEFAULT NULL,
  createdBy BINARY(36) NULL DEFAULT NULL,
  modifiedBy BINARY(36) NULL DEFAULT NULL,
  PRIMARY KEY (id)
);



CREATE TABLE month (
  id BINARY(36) NOT NULL,
  name VARCHAR(45) NOT NULL,
  transmissions INT NOT NULL,
  start DATETIME NOT NULL,
  end DATETIME NOT NULL,
  status ENUM('IN_PROGRESS', 'COMPLETE') NOT NULL,
  isEnable TINYINT(1) NOT NULL DEFAULT 1,
  modifiedOn DATETIME NULL DEFAULT NULL,
  createdOn DATETIME NULL DEFAULT NULL,
  createdBy BINARY(36) NULL DEFAULT NULL,
  modifiedBy BINARY(36) NULL DEFAULT NULL,
  PRIMARY KEY (id)
);



CREATE TABLE  day (
  id BINARY(36) NOT NULL,
  name VARCHAR(45) NOT NULL,
  date DATETIME NOT NULL,
  cameraOne BINARY(36) NOT NULL,
  cameraTwo BINARY(36) NOT NULL,
  cutDesk BINARY(36) NOT NULL,
  month BINARY(36) NOT NULL,
  isEnable TINYINT(1) NOT NULL DEFAULT 1,
  modifiedOn DATETIME NULL DEFAULT NULL,
  createdOn DATETIME NULL DEFAULT NULL,
  createdBy BINARY(36) NULL DEFAULT NULL,
  modifiedBy BINARY(36) NULL DEFAULT NULL,
  PRIMARY KEY (id, month),
  CONSTRAINT cameraOne
    FOREIGN KEY (cameraOne)
    REFERENCES users (id),
  CONSTRAINT cameraTwo
    FOREIGN KEY (cameraTwo)
    REFERENCES users (id),
  CONSTRAINT cutDesk
    FOREIGN KEY (cutDesk)
    REFERENCES users (id),
  CONSTRAINT month
    FOREIGN KEY (month)
    REFERENCES month (id)
);


